import React, { Component } from 'react';

import './App.css';
import 'bootstrap/dist/css/bootstrap.min.css';
import { Switch, Route } from 'react-router-dom';
import uuid from 'uuid';

import Navi from './components/Navi';
import Ques from './components/Ques';
import Rate from './components/Rate';
import Comm from './components/Comm';
import Choi from './components/Choi';
import Logi from './components/Logi';
import Sign from './components/Sign';
import Notf from './components/Notf';

import Inpu from './components/inpu';
import List from './components/List';

class App extends Component {
  render() {

    return (
      <React.Fragment>
        <Navi/>
        <Switch>
          <Route exact path="/" component={Ques} />
          <Route path="/Rate" component={Rate} /> 
          <Route path="/Comm" component={Comm} />
          <Route path="/Choi" component={Choi} />
          <Route path="/Logi" component={Logi} />
          <Route path="/Sign" component={Sign} />
          <Route component={Notf} />
        </Switch>
        <Inpu />
        <List />        
      </React.Fragment>



    );
    }
  }

export default App;
